// Helper: get contests for a specific date
export const getContestsByDate = (dateStr) => {
  return CALENDAR_CONTESTS.filter(c => c.date === dateStr);
};

// Helper: get all dates that have contests
export const getContestDates = () => {
  return [...new Set(CALENDAR_CONTESTS.map(c => c.date))];
};

